// MovieCard.js
import React from "react";
import { Link } from "react-router-dom";

function MovieCard({ imageUrl, altText, title, link }) {
  return (
    <div className="MovieCard">
      <h3>{title}</h3>
      <Link to={link}>
        <img src={imageUrl} alt={altText} width="300" />
      </Link>
    </div>
  );
}

export default MovieCard;
